package com.codingshuttle.tutorial.dataMapping.CollegeManagmentSystem.entites;import jakarta.persistence.*;import lombok.AllArgsConstructor;import lombok.Getter;import lombok.NoArgsConstructor;import lombok.Setter;import java.util.Objects;@NoArgsConstructor@AllArgsConstructor@Getter@Setter@Entitypublic class AdmissionRecord {    @Id    @GeneratedValue(strategy = GenerationType.IDENTITY)    private  Long id;    private Integer fees;    @OneToOne    @JoinColumn(name = "student")    private Student student;    @Override    public boolean equals(Object o) {        if (this == o) return true;        if (o == null || getClass() != o.getClass()) return false;        AdmissionRecord that = (AdmissionRecord) o;        return Objects.equals(id, that.id) && Objects.equals(fees, that.fees);    }    @Override    public int hashCode() {        return Objects.hash(id, fees);    }}